import React from "react";
import useResources from "../hooks/useResources";

export default function UserList() {
  const users = useResources("users");
  return (
    <div>
      <ul>
        {users.map((user) => (
          <li>{user.name}</li>
        ))}
      </ul>
    </div>
  );
}
